import React from 'react';
import "../../styles/Search.css";
import PatientNavBar from '../../components/PatientNavBar';
import PatientFooter from '../../components/PatientFooter';
import DoctorCard from '../../components/Doctors'; // Import the DoctorCard component


function DoctorSearch() {
  // Sample doctor data (you can replace it with your own data)
  const doctors = [
    {
      name: 'Dr. John Cruz',
      specialization: 'Cardiologist',
      credentials: 'MD, FACC',
      profilePicture: 'doctor1.jpg',
    },
    {
      name: 'Dr. Jane Smith',
      specialization: 'Dermatologist',
      credentials: 'MD, FAAD',
      profilePicture: 'doctor2.jpg',
    },
    {
        name: 'Dr. David Johnson',
        specialization: 'Pediatrician',
        credentials: 'MD, FAAP',
        profilePicture: 'doctor3.jpg',
      },
      {
        name: 'Dr. Sarah Brown',
        specialization: 'Oncologist',
        credentials: 'MD, FACP',
        profilePicture: 'doctor4.jpg',
      },
      {
        name: 'Dr. Michael Williams',
        specialization: 'Orthopedic Surgeon',
        credentials: 'MD, FAAOS',
        profilePicture: 'doctor5.jpg',
      },
      {
        name: 'Dr. Emily Wilson',
        specialization: 'Gynecologist',
        credentials: 'MD, FACOG',
        profilePicture: 'doctor6.jpg',
      },
      {
        name: 'Dr. Robert Lee',
        specialization: 'Neurologist',
        credentials: 'MD, FAAN',
        profilePicture: 'doctor7.jpg',
      },
      {
        name: 'Dr. Maria Garcia',
        specialization: 'Endocrinologist',
        credentials: 'MD, FACE',
        profilePicture: 'doctor8.jpg',
      },
      {
        name: 'Dr. William Taylor',
        specialization: 'Dentist',
        credentials: 'DMD',
        profilePicture: 'doctor9.jpg',
      },
      {
        name: 'Dr. Jessica Anderson',
        specialization: 'Psychiatrist',
        credentials: 'MD, FAPA',
        profilePicture: 'doctor10.jpg',
      },
  ];

  return (
    <div className="search-container" id="container">
      <PatientNavBar />
      <div className="info-container">
        <div class="search-box">
          <input type="text" class="search-input" placeholder="Find the doctor you need.."/>
          <button class="search-button">Search</button>
        </div>
        <div className="doctor-grid">
          {doctors.map((doctor, index) => (
            <DoctorCard key={index} doctor={doctor} />
          ))}
        </div>
        {/* The rest of your content */}
      </div>
      <PatientFooter />
    </div>
  );
}

export default DoctorSearch;
